$(function() {
	//异步加载上传组件
	var $input_file = $("input[type=file]");
	if($input_file.length){
		$input_file.each(function(index, el) {
			$(this).removeAttr('hidden').fileinput({//fileinput插件
				language:'zh',             //语言文字
				showCaption:false,         //输入框
				showRemove:false,          //删除按钮
				browseLabel:'',            //按钮文字
				showUpload:false,          //上传按钮
				uploadUrl: $(this).attr('data-url'),//处理上传
				uploadAsync:false          //异步批量上传
			}).on("filebatchselected", function(event, files) {
				$(this).fileinput("upload");
			}).on('filebatchuploadsuccess', function(event, data, previewId, index) {
				var $input_file_hidden=$('input[name='+$(this).attr("name")+'][type=hidden]');
				if($input_file_hidden.length){
					$input_file_hidden.val(data.response.path);
				}else{
					$(this).after("<input type='hidden' name='"+$(this).attr("name")+"' value='"+data.response.path+"' />");
				}
				// 显示上传成功文字
                var $form_group=$(this).parents('.form-group').eq(0);
                $form_group.removeClass('has-danger').addClass('has-success');
                if(!$form_group.find('small.form-control-label').length) $form_group.append('<small class="form-control-label"></small>');
                $form_group.find('small.form-control-label').text(langtxt.fileOK);
			}).on('filebatchuploaderror', function(event, data, previewId, index) {
                // 显示报错文字
                var $form_group=$(this).parents('.form-group').eq(0);
                $form_group.removeClass('has-success').addClass('has-danger');
                if(!$form_group.find('small.form-control-label').length) $form_group.append('<small class="form-control-label"></small>');
                $form_group.find('small.form-control-label').text(data.response.error);
            }).dropify({//dropify插件
				messages:{default:'',replace:'',remove:'X',error:$(this).data('messages-error')}
			}).on('dropify.afterClear', function(event, element){
				// 图片删除后清空头像路径值（空值无法保存）
                var $input_file_hidden=$('input[name='+$(this).attr("name")+'][type=hidden]');
				if($input_file_hidden.length) $input_file_hidden.val('');
            });
		});
	}
	// 城市选择
	var $select_linkage = $(".select-linkage");
	if($select_linkage.length){
		$select_linkage.each(function(){
			var $self_select=$select_linkage.find("select"),
				prov = $self_select.eq(0).data('selected'),
				city = $self_select.eq(1).data('selected'),
				dist = $self_select.eq(2).data('selected');
				city = city?city:undefined;
				dist = dist?dist:undefined;
			$(this).citySelect({url:M['navurl']+'app/system/include/static2/vendor/select-linkage/citydata.min.json',prov:prov, city:city, dist:dist, nodata:"none"});
		});
		$select_linkage.find('select').removeClass("hidden");
	}
	// 多选
	if($('.met-form').length){
		$('.met-form').submit(function(){
			var $checkbox = $(".met-form input[type='checkbox']");
			$checkbox.each(function(){
				var d=$(this),l=d.val();
				if($(".met-form input[name='"+d.attr('name')+"']").length>1){
					var v='',c = $(".met-form input[name='"+d.attr('name')+"']:checked");
					var z = $(".met-form input[data-checkbox='"+d.attr('name')+"']");
					if(c.length==0){
						z.remove();
					}else{
						c.each(function(i){
							v+=(i+1)==c.length?$(this).val():$(this).val()+'|';
						});
						if(z.length>0){
							z.val(v);
						}else{
							$('.met-form').append("<input name='"+d.attr('name')+"' data-checkbox='"+d.attr('name')+"' type='hidden' value='"+v+"' />");
						}
					}
				}
			});
		});
	}
});
